original_question:
$\textbf{Meelihii Hore ee Juan ee Ururinta}$

Juan wuxuu ku habeeyaa shaambadaha ururintiisa waddan iyo tobanaadkii la soo saaray. Qiimihii uu ku iibsaday dukaanka shaambadaha waxay ahaayeen: Brazil iyo Faransiiska, $6$ senti midkiiba, Peru $4$ senti midkiiba, iyo Isbaanishka $5$ senti midkiiba. (Brazil iyo Peru waa waddamo Koonfur Ameerika ah halka Faransiiska iyo Isbaanishkuna ay ku yaalliin Yurub.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70s", (13.5,4.5));
